nter>Waiting for page to finished loading..<br/>Just a minute :)</center></div><div style="clear:both"></div>    </div>    <i class="gamar-panah"></i><div class="garis-bawah"></div>  </div>  <div class="bungkus-pid" id="bungkus-pid3" style="min-height:25px;display:none">    <div class="garis-atas"></div>    <div class="isi-pid" id="isi-bungkus-pid3"></div>    <i class="gamar-panah"></i><div class="garis-bawah"></div>  </div>  <div class="bungkus-pid" id="bungkus-pid4" style="min-height:25px">    <div class="garis-atas"></div>    <div class="isi-pid" id="isi-bungkus-pid4">      <label for="masukan-app-id">Get an Access Token from your own Facebook <b>Application ID</b>:</label>      <div style="text-align:right;margin-bottom:10px">        <a href="" onClick="$('#masukan-app-id').val(ptafioc.acak(ptafioc.aspespes));return false" style="vertical-align:middle;font-size:10px">Rand</a>        <input type="text" id="masukan-app-id" onFocus="this.select()" value="" style="width:150px;text-align:center;padding:0"/>        <span class="tombol-putih" onClick="ptafioc.getToken()">Get Token</span>      </div>      <label for="masukan-akses-token">Or Insert any <b>Access Token</b> you allready have:</label>      <div style="text-align:right">        <input type="text" id="masukan-akses-token" onChange="ptafioc.potongToken()" onClick="this.select()" value="" style="width:300px;text-align:center;padding:0"/>        <span class="tombol" onClick="ptafioc.lodToken()">Load Now</span>      </div>    </div>    <i class="gamar-panah"></i><div class="garis-bawah"></div>  </div>  <div style="float:right;display:none" id="tombol-bawah"></div>    <div class="bungkus-pid" id="bungkus-pid5" style="min-height:25px;display:none;opacity:0.0">    <div class="garis-atas"></div>    <div class="isi-pid" id="isi-bungkus-pid5"><div style="float:right" class="tombol" onClick="ptafioc.pedot(['#bungkus-pid5'],function(){$('.erkon-show').show()})">Hide</div><h3 style="clear: